textDisplay:
@Наталья Кутенко что не устраивает в таймкодах?
Я привела пример, что в "России будущего" таймкоды всегда есть, это очень удобно.
Не все смотрят эфиры сплошняком, кого-то интересует только одна конкретная тема.

@Дагестан За Навального если взять страны с аналогичным ВВП на душу населения и сравнить зарплаты, то выдаваемая Росстатом циферка будет на 10-15% ниже, чем у более успешных государств. Циферки брал за 2018-2019 гг. и оценивал "на глазок", т.е. без проведения масштабных сравнений и использования программирования. Данных по медиане и процентилям для всех стран не нашёл, поэтому более адекватного сравнения провести не получится. 
Если же сравнивать нашу медиану и их среднюю, то ситуация намного хуже. А вот доверять или нет данным Росстата - решать вам )

Можно посчитать более точно, но у меня рабочий компьютер со всеми скриптами и приложениями в ауте с начала недели и ждёт запчасть, без которой не восстановить зашифрованную информацию по рабочим проектам.

@Дагестан За Навального большую часть информации можно найти на сайтах ООН и Всемирного банка. Иногда попадаются интересные циферки в научных работах, но в последнее время они всё чаще закрыты для публичного доступа :(

Когда нормальные сайты были недоступны, ковырял поисковики, в том числе на немецком. В итоге нашёл статистику, в которой говорилось, что медиана зарплаты специалиста в Германии чуть меньше 12 тыс. евро. Меня это удивило, но другого источника с медианой и процентилями не было. Возможно я не до конца понял пояснение, т.к. оно было на немецком. Быть может это была медиана зарплаты специалистов в какой-то конкретной области :\ 

Короче, нужно искать статистику либо на русском, либо на английском языках, пока немецкий находится в стадии активного освоения. Это мне урок на будущее :)
